import React, { Component } from 'react';
import CardList from './CardList';
import { robots } from './robots';
import SearchBox from './SearchBox';

const state = {
	robots: robots,	
	searchfield: ''
}
class App extends Component {
	constructor() {
		this.state ={
			robots: robots,
			searchfield: ''
		}
	}
	render(){
		return (
			<div>
				<div className='tc'>
					<h1>Robofriends</h1>
					<SearchBox/>
					<CardList robots={robots}/>
				</div>
			</div>
		);
	}
}

export default App;
